import React from "react";
import Kartica from "./Kartica";
import infoKartica from "./infoKartica.json"

export default function Proizvodi(){
   return(
      <div className="proizvodi">
         <Kartica naziv={infoKartica.Proizvodi[0].naziv} opis={infoKartica.Proizvodi[0].opis} slika={infoKartica.Proizvodi[0].slika}/>
         <Kartica />
         <Kartica />
         <Kartica />
         <Kartica />
      </div>
   )
}
